import React, {useState} from 'react';
import {Tabs,Tab,Button} from 'react-bootstrap/Tabs'


function ClassTab() {

    const [key, setKey] = useState('class1');

    return (
      <Tabs id="controlled-tab-example" activeKey={key} onSelect={k => setKey(k)}>
        <Tab eventKey="class1" title="class1">

        </Tab>
        <Tab eventKey="class2" title="class2">

        </Tab>
        <Tab eventKey="class3" title="class3">

            </Tab>
            <Tab eventKey="class4" title="class4">

            </Tab>
            <Tab eventKey="class5" title="class5">

            </Tab>
      </Tabs>
);
}
export default ClassTab;
